import React from 'react';
import { useParams } from 'react-router';

import Footer from '../UI/Footer';
import NavBar from '../UI/NavBar';

// import classes from './Detail.module.css';

const DetailPage = () => {
  let { id } = useParams();
  return (
    <div>
      <NavBar />
      <h1>{id}</h1>
      <Footer />
    </div>
  );
};

export default DetailPage;
